import Card from './Card';

export default function Cards(props) {
   const { characters } = props;
   return(
   <>
   <div>
      {
         characters.map(({name,species,gender,image,onClose}) => {
            <Card
            name
            species
            gender
            image
            onClose
            />
         } )
      }
   </div>;
   </>

   ) 
}
